package com.dzf.zxkj.platform.controller.http;

import com.dzf.zxkj.base.controller.BaseController;
import com.dzf.zxkj.base.exception.BusinessException;
import com.dzf.zxkj.common.entity.Json;
import com.dzf.zxkj.common.entity.ReturnData;
import com.dzf.zxkj.platform.model.piaotong.PiaoTongReqVO;
import com.dzf.zxkj.platform.model.piaotong.PiaoTongResVO;
import com.dzf.zxkj.platform.service.http.IVptInvService;
import com.dzf.zxkj.platform.util.zncs.CommonXml;
import lombok.extern.slf4j.Slf4j;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.PostMapping;
import org.springframework.web.bind.annotation.RequestBody;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RestController;

@RestController
@RequestMapping("/vpt/vptinv")
@Slf4j
public class VptInvController extends BaseController {

    @Autowired
    private IVptInvService vptservice;

    @PostMapping("/register")
    public ReturnData<Json> register(@RequestBody PiaoTongReqVO reqvo){
        PiaoTongResVO resvo = new PiaoTongResVO();

        try {
            buildResVO(resvo, reqvo);
            vptservice.saveRegis(reqvo);
            resvo.setCode(CommonXml.rtnsucccode);
            resvo.setMsg("处理成功");
        } catch (Exception e) {
            log.error(e.getMessage(), e);
            resvo.setCode(CommonXml.rtnfailcode);
            resvo.setMsg(e instanceof BusinessException
                    ? e.getMessage() : "处理失败");
        }

        return ReturnData.ok().data(resvo);
    }

    private void buildResVO(PiaoTongResVO resvo, PiaoTongReqVO reqvo){
        resvo.setCode(CommonXml.rtnfailcode);
        resvo.setSign(reqvo.getSign());
        resvo.setSerialNo(reqvo.getSerialNo());
    }

    @PostMapping("/invoiceinfo")
    public ReturnData<Json> invoice(@RequestBody PiaoTongReqVO reqvo){
        PiaoTongResVO resvo = new PiaoTongResVO();

//        StringBuffer sf = new StringBuffer();
//        sf.append("");
//        sf.append("");
//        sf.append("");
//        sf.append("");
//        sf.append("");
//        sf.append("");
//        sf.append("");
//        reqvo.setContent(sf.toString());

        try {
            buildResVO(resvo, reqvo);
            vptservice.updateInvoice(reqvo);
            resvo.setCode(CommonXml.rtnsucccode);
            resvo.setMsg("处理成功");
        } catch (Exception e) {
            log.error(e.getMessage(), e);
            resvo.setCode(CommonXml.rtnfailcode);
            resvo.setMsg(e instanceof BusinessException
                    ? e.getMessage() : "处理失败");
        }

        return ReturnData.ok().data(resvo);
    }
}
